import React from 'react';
import { Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Home.css';
import './Home.scss';
import NavbarComponent from './Navbar';
import { Container, Row , Col} from 'reactstrap';

const HomeComponent=() => {
    return (
        <>
        <NavbarComponent />
        <div id='bg-image'>
            <Container>
                <div id="home-text">
                <p id="topic-text">The Wonderful Trip Planner</p>
                <p id="highlight-text">Adventure</p>
                
                </div>
                <div
        style={{
          background: '#FAFF03',
          height: '3px',
          width: '100px',
        }}
      />
            </Container>
        </div>
        </>
        
    );
}

export default HomeComponent;
